implementation: openjdk
name: n-queens
description: | # https://leetcode.com/problems/n-queens/description/
    The n-queens puzzle is the problem of placing n queens on an n x n chessboard such that no two queens attack each other.
    Given an integer n, return all distinct solutions to the n-queens puzzle. You may return the answer in any order.
    Each solution contains a distinct board configuration of the n-queens' placement, where 'Q' and '.' both indicate a queen and an empty space, respectively.

    Constraints:
    - 1 <= n <= 9
code: | # https://leetcode.com/problems/n-queens/solutions/5988136/beats-100-list-of-common-backtracking-problems
    import java.util.*;

    public class Program {
        private boolean isSafePlace(int n, char[][] nQueens, int row, int col) {
            for (int i = 0; i < n; i++) {
                if (nQueens[i][col] == 'Q') {
                    return false;
                }
            }

            for (int i = row - 1, j = col - 1; i >= 0 && j >= 0; i--, j--) {
                if (nQueens[i][j] == 'Q') {
                    return false;
                }
            }

            for (int i = row - 1, j = col + 1; i >= 0 && j < n; i--, j++) {
                if (nQueens[i][j] == 'Q') {
                    return false;
                }
            }

            return true;
        }

        private void solveNQueens(int n, List<List<String>> output, char[][] nQueens, int row) {
            if (row == n) {
                List<String> solution = new ArrayList<>();
                for (char[] rowArray : nQueens) {
                    solution.add(new String(rowArray));
                }
                output.add(solution);
                return;
            }

            for (int col = 0; col < n; col++) {
                if (isSafePlace(n, nQueens, row, col)) {
                    nQueens[row][col] = 'Q';
                    solveNQueens(n, output, nQueens, row + 1);
                    nQueens[row][col] = '.';
                }
            }
        }

        public List<List<String>> solveNQueens(int n) {
            List<List<String>> output = new ArrayList<>();
            char[][] nQueens = new char[n][n];

            for (int i = 0; i < n; i++) {
                Arrays.fill(nQueens[i], '.');
            }

            solveNQueens(n, output, nQueens, 0);
            return output;
        }

        public static void main(String[] args) {
            if (args.length < 1) return;
            int n;
            try {
                n = Integer.parseInt(args[0]);
            } catch (NumberFormatException e) {
                return;
            }
            Program sol = new Program();
            List<List<String>> res = sol.solveNQueens(n);

            if (res.isEmpty()) {
                System.out.println("[]");
                return;
            }

            StringBuilder sb = new StringBuilder();
            sb.append("[");
            for (int i = 0; i < res.size(); i++) {
                if (i > 0) sb.append(", ");
                sb.append("[");
                List<String> board = res.get(i);
                for (int j = 0; j < board.size(); j++) {
                    if (j > 0) sb.append(", ");
                    sb.append("\"").append(board.get(j)).append("\"");
                }
                sb.append("]");
            }
            sb.append("]");
            System.out.println(sb.toString());
        }
    }
